import SerachBar from "../shared/SerachBar";

import React from "react";
import "../styles/home.css";

import { Container, Row, Col } from "reactstrap";
import heroImg from "../assets/images/hero-img01.jpg";
import heroImg02 from "../assets/images/hero-img02.jpg";
import heroVideo from "../assets/images/hero-video.mp4";
import world from "../assets/images/world.png";
import Subtitle from "../shared/Subtitle";

import ServiceList from "../services/ServiceList";
import FeaturedTourList from "../Featured-tours/FeaturedTourList";

const Home = () => {
  return (
    <>
      {/* Hero section */}
      <section>
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtitle d_flex align-items-center">
                  <Subtitle subtitle={"Tabrak tabrak masuk"} />{" "}
                  {/* Fixed prop name */}
                  <img src={world} alt="World Map" />
                </div>
                <h1>
                  Traveling opens the door to creating{" "}
                  <span className="highlight">memories</span>
                </h1>
                <p>
                  Lorem ipsum dolor sit amet consectetur adipisicing elit.
                  Voluptate eius voluptatem molestiae a voluptates repellendus
                  voluptatum aspernatur modi voluptatibus quod?
                </p>
              </div>
            </Col>

            <Col lg="2">
              <div className="hero__img-box">
                <img src={heroImg} alt="Hero Image 1" />
              </div>
            </Col>
            <Col lg="2">
              <div className="hero__img-box mt-4">
                <video src={heroVideo} alt="Hero Video" controls />
              </div>
            </Col>
            <Col lg="2">
              <div className="hero__img-box mt-5">
                <img src={heroImg02} alt="Hero Image 2" />
              </div>
            </Col>
            <Col lg="12">
              <SerachBar /> {/* Fixed typo */}
            </Col>
          </Row>
        </Container>
      </section>

      {/* Services section */}
      <section>
        <Container>
          <Row>
            <Col lg="3">
              <h5 className="services__subtitle">What We Serve</h5>
              <h2 className="services__title">
                We Offer Our Best Services
              </h2>{" "}
              {/* Fixed text */}
            </Col>
            <Col lg="9">
              <ServiceList />
            </Col>
          </Row>
        </Container>
      </section>

      {/* Featured tour section */}
      <section>
        <Container>
          <Row>
            <Col lg="12" className="mb-5">
              <h5 className="subtitle">Explore</h5>
              <h2 className="featured__tour-title">Our Featured Tours</h2>{" "}
              {/* Fixed text */}
            </Col>
            <FeaturedTourList />
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Home;
